</style><!--iif(JAVA)
<script type="text/javascript">
var toggle = function(e) {
	var elem = e.target;
	var elemNext = elem.nextElementSibling;
	if (elemNext){
		var st = elemNext.style;
		if (st)
			if (st.display == "none"){
				elem.className = "expanded";
				st.removeProperty("display");
			}else{
				elem.className = "collapsed";
				st.display = "none";
			}
	}
}
window.onload = function() {
	var elems = document.getElementsByClassName("expanded");
	for(var i = 0; elems.length > i; i++) {
		var elem = elems[i]
		elem.onclick = toggle;
		var elemNext = elem.nextElementSibling;
		if (elemNext){
			var st = elemNext.style;
			if (st)
				st.removeProperty("display");
		}
	}
	elems = document.getElementsByClassName("collapsed");
	for(var i = 0; elems.length > i; i++) {
		var elem = elems[i]
		elem.onclick = toggle;
		var elemNext = elem.nextElementSibling;
		if (elemNext){
			var st = elemNext.style;
			if (st)
				st.display = "none";
		}
	}
}
function zoom(w) {
	var oNodes = document.getElementsByTagName("img");
	if (oNodes){
		var oNode;
		for (var i=0; oNodes.length > i; i++){
			oNode = oNodes[i];
			if (oNode.className == "z"){
				if (oNode.style)
					oNode.style.width = w;
				oNode.width = w;
			}
		}
	}
}</script> iif-->
